window.bookSummaryJSON = "<p>Who would have ever thought a job interview would land me in a fantasy world? There are monsters and magic. I’ve discovered I’m pretty good at taming the former while my companions handle the latter.</p> <p>Speaking of my companions, back on Earth, I would have counted myself lucky to have a single one of them look my way. Here, in the world of Sanctum? I’m surrounded by them.</p> <p>Together, we’re exploring this strange world, catching monsters and mastering magic. Our base will need upgrading, and that’ll mean gathering more resources. Tools and weapons? Those’ll need upgrading too.</p> <p>All the while, we’ve got the deadly denizens of this world to contend with.</p> <p>It’s just another day in the world of Sanctum, filled with danger and peril, but I wouldn’t have it any other way.</p>"; 
